function randomHi() {
        const coinflip = (max) => {return Math.floor(Math.random() * max);}
        const possibleGreetings = [`listening.wav`,`_listening.wav`];
        const random1 = coinflip(possibleGreetings.length);
        return possibleGreetings[random1];
}
    
